css:
.command {
  cursor: default;
}
.command .top {
  display: flex;
  flex-flow: row wrap;
  justify-content: space-between;
}
.command .top .align {
  display: flex;
  padding: 0 0 0 5px;
}
.command .top-expanded {
  border-radius: 5px 5px 0 0;
}
.command .module {
  display: flex;
}
.command .module .text-padded {
  padding: 0 0 0 5px;
}
.command .hidden {
  display: none;
}
